import numpy as np

def dp_dt(t, p, k0, k1):
    return (k0 + k1 * p) * p

# Método de Runge-Kutta de quarta ordem
def runge_kutta(C0, k0, k1, dt, T):
    num_steps = int(T / dt)
    time = np.linspace(0, T, num_steps + 1)
    concentrations = np.zeros(num_steps + 1)
    concentrations[0] = C0

    for i in range(1, num_steps + 1):
        k1 = dt * dp_dt(time[i - 1], concentrations[i - 1], k0, k1)
        k2 = dt * dp_dt(time[i - 1] + 0.5 * dt, concentrations[i - 1] + 0.5 * k1, k0, k1)
        k3 = dt * dp_dt(time[i - 1] + 0.5 * dt, concentrations[i - 1] + 0.5 * k2, k0, k1)
        k4 = dt * dp_dt(time[i - 1] + dt, concentrations[i - 1] + k3, k0, k1)

        concentrations[i] = concentrations[i - 1] + (k1 + 2 * k2 + 2 * k3 + k4) / 6
        print(f"Numero da população após {i * dt} anos: {concentrations[i]:.2f}")

    return time, concentrations

